import React from 'react'
import Markdown from 'markdown-to-jsx'

const MyParagraph = ({children, ...props}) => (
    <div {...props}>{children}</div>
)
const MarkdownFile = () => {
    return (
        <Markdown
            options= {{
                overrides: {
                    h1: {
                        component: MyParagraph,
                        props: {
                            className: 'foo',
                        }
                    }
                }
            }}>
            # Hello world

        </Markdown>
      );
}
 
export default MarkdownFile;
